import React, { useEffect, useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import {
  useParams,
  useNavigate,
  useSearchParams,
  Outlet,
} from 'react-router-dom';
import styles from './Nastavnici.module.css';
import UcenikRow from './UcenikRow';
import { ucitajUcenika, obrisiUcenika } from '../redux/ucenici/actions';
import { ucitajUcenikoveRazrede } from '../redux/odjeljenjaRazredi/actions';

const UcenikTest = (props) => {
  const { idRazred } = useParams();
  const { idUcenik } = useParams();
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { loading } = useSelector((state) => state.razredi);
  const [ucenikoviRazredi] = useSelector((state) =>
    state.ucenici.items.filter((ucenik) => ucenik.idRazred === +idRazred)
  );

  useEffect(() => {
    if (!ucenikoviRazredi) {
      dispatch(ucitajUcenikoveRazrede(+idUcenik));
    }
  }, [dispatch, idUcenik, ucenikoviRazredi]);

  useEffect(() => {
    navigate('/ucenici/' + idUcenik + ucenikoviRazredi[0].idRazred);
  }, []);

  if (loading) {
    return <h1>Loading...</h1>;
  }
  if (!ucenikoviRazredi) {
    return <h1>Ucenikovi razredi doesn't exist</h1>;
  }

  return (
    <>
      <div key={ucenikoviRazredi.idRazred} className={styles.nastavnici}>
        ooo
      </div>
    </>
  );
};

export default UcenikTest;
